import {
  Box,
  Stack,
  HStack,
  VStack,
  Link,
  Divider,
  Image,
  Text,
  Button,
  IconButton,
  LinkProps
} from '@chakra-ui/react';
import { FaGithub } from 'react-icons/fa';
import { BsDiscord } from 'react-icons/bs';

import styles from './Footer.module.css'

export const Footer = () => {
  return (
    <footer>
      <Box className={styles.footer}>
        <Divider my={4} height='100%'/>

        <Stack my={4} width='full' align='center' justifyContent='center'>
          <Text className={styles.divisor} fontSize="md" >
            Built by Lucas D
          </Text>
        </Stack>
      </Box>
    </footer>
  );
};
